;(function(window, ht) {
    var E = window.Editor = {
        leftWidth: 0,
        topHeight: 40,
        randomList: function(max, size) {
            var list = [], ran;
            while (list.length < size) {
                ran = Math.floor(Math.random() * max);
                if (list.indexOf(ran) >= 0) 
                    continue;
                list.push(ran);
            }
            return list;
        }
    };

    ht.Default.setImage('door', 'data:image/png;base64,');

    var t = 4, w = 128 * t, h = 256 * t;
    var imgList = [
        { 
            name: '', 
            img: './symbols/.json'
        }, {
            name: '2', 
            img: './symbols/2.json'
        }, {
            name: '3', 
            img: './symbols/3.json'
        }, {
            name: ' ',
            img: './symbols/ .json'
        }, {
            name: ' ',
            img: './symbols/ .json'
        }, {
            name: '',
            img: './symbols/.json'
        }, {
            name: ' ',
            img: './symbols/ .json',
            w: 128 * t,
            h: 32 * t
        }, {
            name: 'icon ',
            img: './symbols/icon .json',
            w: 74 * t,
            h: 64 * t
        }
    ];

    imgList.forEach(function(item) {
        item.canvas = ht.Default.toCanvas(item.img, item.w || w, item.h || h);
        ht.Default.setImage(item.name, item.canvas);
    }); 

    ht.Default.handleImageLoaded = function(imgName, json) {
        imgList.forEach(function(item) {
            if (item.img === imgName) 
                item.json = json;

            if (!item.json) return;

            var g = item.canvas.getContext('2d');
            g.clearRect(0, 0, item.w || w, item.h || h);
            ht.Default.drawImage( g, item.json, 0, 0, item.w || w, item.h || h );
        }); 
    }
}(window, ht));